        <AgGridColumn
          field="corrosion"
          headerName="Corrosion"
          headerTooltip="Corrosion"
          //minWidth={100}
          editable={true}
        />,
        <AgGridColumn
          field="image"
          headerName="Image"
          headerTooltip="Image"
          //minWidth={100}
          editable={true}
        />,
        
      ];
      const addVisualCorrosionRows=(n)=>{
        let newRows=[]
        let i=1
        while(n>0){
            newRows=[...newRows,{level:`L${i}`,corrosion:'',image:''}]
            n--
            i++
        }
        /* eslint-disable */console.log(...oo_oo(`a9d96b36_1`,newRows));
        setVisualCorrosionRows(newRows)
    }

    const addVisualActionRows=()=>{
        let rows=[]
        VisualWearRows.map(wearRow=>{
            VisualCorrosionRows.map(corrosionRow=>{
                rows=[...rows,{wear:wearRow.level,corrosion:corrosionRow.level,alarm:'Show on dashboard',invalid:false}]
            })
        })
        /* eslint-disable */console.log(...oo_oo(`a9d96b36_2`,rows));
        setVisualActionRows(rows)
