        let newRows=[]
        while(n>0){
            newRows=[...newRows,{EquipmentId:eqptId,ComponentId:props.selectedComponent.id,id:uuid(),name:'',unit:'',min:'',max:'',level:'',frequency:'',data:''}]
            n--
        }
        /* eslint-disable */console.log(...oo_oo(`a9d96b36_4`,newRows));
        setpRows(newRows)
