          headerName="Maximum Value"
          headerTooltip="Maximum Value"
          //minWidth={100}
          editable={true}
        />,
        <AgGridColumn
          field="level"
          headerName="Level"
          headerTooltip="Level"
          //minWidth={100}
          editable={true}
        />,
