                        <div className={styles.levelCol}>
                            <div className={styles.sectionHead}>Wear</div>
                            <div className={styles.sectionHead}>Corrosion</div>
                        </div>
                        <div className={styles.levelCol}>
                            <div className={styles.formField}>
                                <label htmlFor='degradation-wear-level'>No. of levels</label>
                                <input className={styles.input} value={degradationWearLevels} onChange={changeDegradationWearLevel} type='number' id='degradation-wear-level' name='degradation-wear-level'/>
                            </div>
                            <div className={styles.formField}>
                                <label htmlFor='degradation-corrosion-level'>No. of levels</label>
                                <input className={styles.input}  type='text' id='degradation-corrosion-level' name='degradation-corrosion-level'/>
                            </div>
                        </div>
                        <div className={styles.levelCol}>
                        
                        </div>
                    </div>
            </>}
            {condition==='sensorBased'&&<>
            <RadioGroup
                row
                name="monitoring-type"
                value={monitoringType}
                onChange={(e)=>setMonitoringType(e.target.value)}
                className={styles.sensorRadio}
            >
                <div>
                    <FormControlLabel  labelPlacement='start' value="intermittent" control={<Radio />} label="Intermittent Monitoring" />
                </div>
                <FormControlLabel  labelPlacement='start' value="continuous" control={<Radio />} label="Continuous Monitoring" />
            </RadioGroup>
            <div className={styles.parameters}>
                <div className={styles.formField}>
                    <label htmlFor='parameters'> Number of parameters</label>
                    <input className={styles.input} value={numPara} onChange={(e)=>setNumPara(e.target.value)}  type='number' id='parameters' name='parameters'/>
                    <Button onClick={()=>addPRows(numPara)} variant='contained' color='primary' style={{marginLeft:10}}>Submit</Button>
                </div>
                <div className={styles.formField}>
                    <label htmlFor='parameters'> Define parameters</label>
                    <Table
                    columnDefs={parameterColumnDefs}
                    rowData={pRows}
                    tableUpdate={updateParameterRowData}
                    height={200}
                    />
                </div>
                
            </div>
            {/* <div className={styles.levelwise}>
            <div className={styles.lwCol}>
                Level Wise Parameters
                <Table
                    columnDefs={lvlwiseColumnDefs}
                    rowData={lvlwiseRows}
                    tableUpdate={(data)=>console.log(data)}
                    height={200}
                    />
            </div>
            <div className={styles.lwCol}>
                Alarms
                <Table
                    columnDefs={sbAlarmCols}
                    rowData={sbAlarmRows}
                    tableUpdate={(data)=>console.log(data)}
                    height={200}
                    />
            </div>
            </div> */}
            </>}
            </div>}
        </div>
        {SnackBarMessage.showSnackBar && (
        <CustomizedSnackbars
          message={SnackBarMessage}
          onHandleClose={onHandleSnackClose}
        />
      )}
    </>
    );
